import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

// React 18 rendering root
const root = ReactDOM.createRoot(document.getElementById('root'));

// Rendering the main App inside React.StrictMode
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Optional: Logs performance metrics to console (optional)
reportWebVitals(console.log);
